import React, { Component } from 'react'
import axios from 'axios';
import Store from './MyStore';

class MyStores extends Component {
    state = { stores: [] }
    componentDidMount() {
        axios.get(`http://localhost:64430/api/Enterprises`).then(x => {
            console.log(x.data);
            this.setState({ stores: x.data });
        });
    }
    render() {
        return (
            <div>
                <h1> my stroes</h1>
                <div>
                    {this.state.stores.map((x, i) => {
                        return <Store name={x.Name} url={x.Url} key={i}></Store>
                    })}
                </div>
            </div>
        )
    }
}
export default MyStores;
